import React from "react";
import { Field } from "formik";

interface InputFormFieldProps {
  name: string;
  label: string;
  autoComplete?: string;
}

export const InputFormField: React.FC<InputFormFieldProps> = ({
  name,
  label,
  autoComplete = "off",
}) => {
  return (
    <div>
      <label>{label}</label>
      <Field name={name} as="input" autoComplete={autoComplete}></Field>
    </div>
  );
};
